@import url('https://fonts.googleapis.com/css?family=Montserrat:100,200,300,400,500,600,700|Roboto:100,300,400,500,700&display=swap');

$black: #232946;
$white: #fffffe;
$lightgray: rgba(255, 255, 255, .1);
$darkgray: rgba(0, 0, 0, .8);

$main1: #eebbc3;
$main2: #b8c1ec;

$mobile: 920px;

@mixin after-black {
    content: "";
    position: absolute;
    right: 0;
    top: 0px;
    width: 100%;
    height: 100%;
    background: $black;
}

$techSlide: -39;
$circleSpeed: 30s;

